import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlay, faStop, faCheck, faTrash, faCarSide } from '@fortawesome/free-solid-svg-icons';


import Button from 'components/commons/Button/Button';

import styles from './CarTrack.module.scss';

function CarTrack() {

   return(
      <div className = { styles.carTrack}>
         <div className = { styles.controlBlock }>
            <Button style = { styles.controlBlockBtn } name = { <FontAwesomeIcon icon = { faPlay } color = "#28a745" /> }/>
            <Button style = { styles.controlBlockBtn } name = { <FontAwesomeIcon icon = { faCheck } color = "#48bfeeff" /> }/>
            <Button style = { styles.controlBlockBtn } name = { <FontAwesomeIcon icon = { faStop } color = "#ffc107" /> }/>
            <Button style = { styles.controlBlockBtn } name = { <FontAwesomeIcon icon = { faTrash } color = "#dc3545"/> }/>
         </div>
         <CarIcon />
      </div>
   )
}
const CarIcon = ({ width = 64, height = 64, color = "#000" }) => (
   <svg
    xmlns="http://www.w3.org/2000/svg"
    viewBox="0 0 640 512"
    width={width}
    height={height}
    fill={color}
  >
    {/* Body of the car */}
    <path d="M624 368h-16V304c0-16.9-13.1-30-30-30h-40l-32-80c-4.4-11-15.1-18-27-18H161c-11.9 0-22.6 7-27 18l-32 80h-40c-16.9 0-30 13.1-30 30v64H16c-8.8 0-16 7.2-16 16v32c0 8.8 7.2 16 16 16h32c0 35.3 28.7 64 64 64s64-28.7 64-64h256c0 35.3 28.7 64 64 64s64-28.7 64-64h32c8.8 0 16-7.2 16-16v-32c0-8.8-7.2-16-16-16zM161 144h318l28 70H133l28-70zM112 304h416v48H112v-48zm-32 80c-17.7 0-32-14.3-32-32s14.3-32 32-32 32 14.3 32 32-14.3 32-32 32zm448 0c-17.7 0-32-14.3-32-32s14.3-32 32-32 32 14.3 32 32-14.3 32-32 32z"/>
    {/* Windows */}
    <path d="M160 160h320v64H160z" fill="#fff"/>
    {/* Headlights */}
    <circle cx="64" cy="368" r="16" fill="#fff"/>
    <circle cx="576" cy="368" r="16" fill="#fff"/>
  </svg>
);



export default CarTrack;
